import React, {Component} from 'react';
import {Card} from 'react-bootstrap';

export class Result extends React.Component {
    render() {
        return (
            <Card>
                <Card.Img variant="top" src={this.props.image} />
                <Card.Body>
                    <Card.Title>
                        {this.props.pName}
                    </Card.Title>
                    <Card.Text>
                        {this.props.pSName}
                        <br/>
                        {this.props.difficulty}
                    </Card.Text>
                </Card.Body>
            </Card>
        )
    }
}
